class TopModule extends RawModule {
  // Define input and output ports
  val in = IO(Input(UInt(255.W)))  // 255-bit input
  val out = IO(Output(UInt(8.W)))   // 8-bit output

  // Define the population count using the built-in method
  out := PopCount(in)(7, 0)  // Calculate population count and extract the lower 8 bits
}
